    }

    render(){

        let style ={
            width: '100%'
        }

        return(
            <div style={style}>
                <p style={{float: 'left', marginLeft: '0px', width:'100px',overflow: 'hidden'}}>{this.state.number}</p>
                <p style={{float: 'left', marginLeft: '70px', width:'150px', overflow: 'hidden'}}>{this.state.name}</p>
                <p style={{float: 'left', marginLeft: '70px', width: '40px',overflow: 'hidden'}}><button>edit</button></p>
                <p style={{float: 'left', marginLeft: '10px', marginLeft: '15px', width: '50px', overflow: 'hidden'}}><button>delete</button></p>
            </div>
        )
    }
}

export default CameraItem
